description:
En fore detta kristen missionar har tappat tron efter att hennes 
familj tragiskt omkommit och har sedan dess blivit en valkand 
expert pa att motbevisa religiosa fenomen. Men nar hon undersoker 
en liten stad i Louisiana som lider av problem som kan liknas vid de 
gamla bibliska plagorna inser hon att vetenskapen inte kan forklara 
allt. 
